import { Modal, Select, Button, Input } from 'antd';
import { useState } from 'react';
import './style-addNew.css';

function AddNew(props) {
  const { Option } = Select;

  return (
    <>
      <Modal
        visible={props.visible}
        title={props.title}
        onOk={props.handleOk}
        onCancel={props.handleCancel}
        width="330px"
        footer={[
          <Button key="back" onClick={props.handleCancel}>
            Close
          </Button>,
          <Button key="submit" type="primary" onClick={props.handleOk}>
            Add
          </Button>,
        ]}
      >
        <Select
          className="AddNew-Popup"
          showSearch
          style={{
            width: `80%`,
            marginLeft: `13%`,
          }}
          placeholder={props.selectName}
          onChange={props.SaveSelect}
        >
          <Option value="New York">New York</Option>
          <Option value="London">London</Option>
          <Option value="London">Palestine</Option>
          <Option value="London">Nablus</Option>
        </Select>
        <Input
          className="AddNew-Input"
          type="text"
          placeholder={props.Name}
          value={props.jobLocation}
          onChange={props.handleChangeLocation}
          style={{ marginTop: '22px', width: `80%`, marginLeft: `13%` }}
        />
      </Modal>
    </>
  );
}

export default AddNew;
